service:
  enabled: true
  single: true
  type: ClusterIP

autoscaling: 
  enabled: true
  minReplicas: 3
  maxReplicas: 6
  metrics: 
  - resource:
      name: cpu
      target:
        averageUtilization: 70
        type: Utilization
    type: Resource
  - resource:
      name: memory
      target:
        averageUtilization: 80
        type: Utilization
    type: Resource
  scaleTargetRef:
    apiVersion: apps/v1
    kind: Deployment
    name: "{{ template \"traefik.fullname\" . }}"

# [TODO] Uncomment and set proper values
# resources: {}

nodeSelector:
  oke.oraclecloud.com/pool.name: traefik
topologySpreadConstraints:
  - labelSelector:
      matchLabels:
        app.kubernetes.io/name: traefik
    maxSkew: 1
    topologyKey: kubernetes.io/hostname
    whenUnsatisfiable: DoNotSchedule
